import './App.css';
import axios from 'axios';
import React from 'react';


class App extends React.Component{
  state = { default: [], }

  componentDidMount(){
    let data;
    axios.get('http://127.0.0.1:8000/')
    .then(res => {
      data = res.data;
      this.setState({
        details: data
      });
    })
    .catch(err => {
      console.log(err);
    })
  }
  render(){
    return (
      <div>
        <header> Title</header>
        {/* <hr></hr> */}
        {this.state.details.map((output, id) => (
          <div key={id}>
            <div>
              <h3>{output.name}</h3>
              <p>{output.model}</p>
              <p>{output.year}</p>
              <p>{output.color}</p>
              <p>{output.price}</p>
            </div>
          </div>
        ))}
      </div>
    )
  }
}

export default App;
